import { Link } from "react-router-dom";
import React from "react";
import MedianCol from "./images/MedianCol.png";


function Header() {
    const style = {

        global: {
            height: "100px",
            backgroundColor: "gray",

        },
        image: {
            height: '50%'
        }
    }
    return (
        <header style={style.global}>
            <div className="container" style={style.global}>

                <div className="row">
                    <div className="col-sm-4">

                        <img src={MedianCol} alt="app logo" style={style.image} />
                    </div>
                    <div className="col-sm-4"></div>
                    <div className="col-sm-1 align-self-center mr-1">
                        <Link to="/home">MedianCOL </Link>
                    </div>
                    <div className="col-sm-1 align-self-center mr-1"><Link to="/projects"> About</Link></div>
                    <div className="col-sm-1 align-self-center"><Link to="/Contact"> LivingCost</Link></div>

                </div>

            </div>

        </header>
    )
}

export default Header;
